            .head {
                display: flex;
                align-items: flex-start;

                .company_icon {
                    max-width: 64px;
                    height: 60px;
                    margin-right: 30px;
                }

                ul {
                    text-align: start;

                    .name {
                        font-size: 24px;
                        font-style: normal;
                        font-weight: 500;
                        line-height: normal;
                        margin-bottom: 3px;
                    }

                    .status {
                        font-size: 18px;
                        font-style: normal;
                        font-weight: 400;
                        line-height: normal;
                        color: $accent-color;
                    }
                }
            }

            .cart_desc {
                width: 100%;
                max-height: 40%;
                font-size: 16px;
                font-style: normal;
                font-weight: 400;
                line-height: 30px;
                color: $secondary-color;
                text-align: start;
                margin: 30px 0;
                word-break: break-all;
                overflow: hidden;
            }

            .control {
                display: flex;
                align-items: center;
                justify-content: space-between;

                .icon {
                    margin-right: 80px;

                    svg {
                        margin-right: 25px;
                        fill: $secondary-color;
                        cursor: pointer;
                    }
                }

                a {
                    font-size: 16px;
                    font-style: normal;
                    font-weight: 600;
                    line-height: normal;
                    padding: 9px 35px;
                }

                .btn {
                    &:hover {
                        border-radius: 8px;
                        background-color: $accent-color;
                    }
                }
            }
        }
    }
}
